Cookies
Greenmangaming.com and playfire.com use cookies in order to improve your user experience by enabling that website to ‘remember’ you, either for the duration of your visit (using a ‘session cookie’) or for repeat visits (using a ‘persistent cookie’). Our cookies do lots of different jobs, like letting you navigate between pages efficiently, storing your preferences, and generally improving your experience of a website.
Cookies make the interaction between you and the website faster and easier - if a website doesn’t use cookies, it will think you are a new visitor every time you move to a new page on the site. For example, when you enter your login details and move to another page it won’t recognise you and it won’t be able to keep you logged in. Greenmangaming.com and playfire.com also use cookies to enable Us to target advertising or marketing messages based for example, on your location and/or browsing habits. Cookies may be set by the greenmangaming.com and playfire.com ('first party cookies') or they may be set by other websites who run content or services for Us (such as Google Analytics) on the page you are viewing ('third party cookies').
What is in a cookie?
A cookie is a simple text file that is stored on your computer or mobile device by a website’s server and only that server will be able to retrieve or read the contents of that cookie. Each cookie is unique to your web browser. It will contain some anonymous information such as a unique identifier and the site name and some digits and numbers. It allows a website to remember things like your preferences or what’s in your shopping basket.
What to do if you don’t want cookies to be set
Some people find the idea of a website storing information on their computer or mobile device a bit intrusive, particularly when this information is stored and used by a third party without them knowing. Although this is generally quite harmless you may not, for example, want to see advertising that has been targeted to your interests. If you prefer, it is possible to block some or all cookies, or even to delete cookies that have already been set; but you need to be aware that you might lose some functions of the website.
No Cookies please!
If you wish to restrict or block web browser cookies which are set on your device then you can do this through your browser settings; the Help function within your browser should tell you how. Alternatively, you may wish to visit www.aboutcookies.org, which contains comprehensive information on how to do this on a wide variety of desktop browsers. We use ‘cookies’ on the Service. If you do not wish for Us to use cookies when you use the Service please adjust your Internet browser settings to not accept cookies. Your computer's help file should tell you how to do this but please note that this may affect your ability to use the Service and Games.
By agreeing to these terms you are specifically allowing the Service to execute all cookies as are required for the Service to operate as efficiently as possible with the best user experience in mind. If you don’t disable cookies the Service will ask for and store details including your name and email address and may automatically insert certain information on the subscription or Communications forms so that you can use the Service with less form filling.
